import React, { Component } from "react";
import moment from "moment";
import "../styles/style.css";

export default function DisplayOrders(props) {
  const [listData1, setListData1] = React.useState([]);

  React.useEffect(() => {
    console.log(props.location);
    setListData1(props.location.state);
  });

  return (
    <div>
      <div class="data">
        <label>ðŸ“¦ Order Details</label>
      </div>
      <table id="customers">
        <tr>
          <th>Serial Number</th>
          <th>Parcel Id</th>
          <th>Arrival Date</th>
          <th>Sender</th>
          <th> Location Id</th>
          <th> Location Name</th>
          <th> User Name</th>
          <th> User PhoneNumber</th>
          <th> ETA</th>
          <th> Delivery Status</th>
        </tr>
        {listData1 !== undefined ? (
          <tr>
            <td>1</td>
            <td>{listData1.parcel_id}</td>
            <td>{moment(listData1.last_updated).format("MM/DD/YYYY")}</td>
            <td>{listData1.sender}</td>
            <td>{listData1.location_id}</td>
            <td>{listData1.location_name}</td>
            <td>{listData1.user_name}</td>
            <td>{listData1.user_phone}</td>
            <td>{moment(listData1.eta).format("MM/DD/YYYY")}</td>
            <td>{listData1.status}</td>
          </tr>
        ) : (
          []
        )}
      </table>
    </div>
  );
}
